  \"2016-07-27T22:24:35.551655\",\n\t\"name\": \"final-environmental-assessment-for-the-2011-proposed-hunting-plan-northern-tallgrass-prair\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The United States Fish and Wildlife Service
  proposes to provide compatible hunting opportunities for migratory game bird, upland
  game, and big game species on units of the Northern Tallgrass Prairie National Wildlife
  Refuge located within 85 counties in western Minnesota and northwestern Iowa. This
  environmental assessment evaluates three possible alternatives for the hunting opportunities.
  The proposed action alternative will establish compatible hunting opportunities
  while providing non-hunting visitors with other priority public use opportunities
  i.e. wildlife observation, wildlife photography, environmental education and interpretation.
  The approved acquisition boundary includes habitat easements, which will stay in
  private ownership, and lands purchased in fee title. The objective of this hunting
  program is to provide the public with safe and enjoyable hunts that are compatible
  with refuge purposes, minimize conflict with other public use activities, and donu2019t
  adversely affect localized wildlife populations.\",\n\t\"license_title\": \"License
